import React, { useState } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import { FaClock, FaCompass, FaDollarSign, FaMapMarkerAlt, FaPlus, FaSearch } from 'react-icons/fa';
import LandingImage from '../assets/images/landing.jpg';

export default function Home() {
  const navigate = useNavigate();
  const [query, setQuery] = useState('');
  const [filters, setFilters] = useState({
    billing: 'Monthly',
    min: '',
    max: '',
    urgency: false,
    map: false,
    more: false
  });

  const handleToggle = (key) => {
    setFilters((prev) => ({ ...prev, [key]: !prev[key] }));
  };

  const handleRangeChange = (key, label) => {
    const value = window.prompt(`Set ${label} budget (BAM)`, filters[key]);
    if (value === null) return;
    setFilters((prev) => ({ ...prev, [key]: value.trim() }));
  };

  const handleSearch = (event) => {
    if (event) {
      event.preventDefault();
    }
    const params = new URLSearchParams();
    if (query.trim()) params.set('search', query.trim());
    if (filters.billing) params.set('billing', filters.billing.toLowerCase());
    if (filters.min) params.set('min', filters.min);
    if (filters.max) params.set('max', filters.max);
    if (filters.urgency) params.set('urgency', 'true');
    if (filters.map) params.set('map', 'true');
    if (filters.more) params.set('more', 'true');
    navigate(`/properties?${params.toString()}`);
  };

  return (
    <div className="home-page">
      <section className="home-search">
        <form className="home-search-bar" onSubmit={handleSearch}>
          <label className="search-pill search-pill-input">
            <FaSearch />
            <input
              type="text"
              placeholder="Where are you looking?"
              aria-label="Search location"
              value={query}
              onChange={(event) => setQuery(event.target.value)}
            />
          </label>
          <button
            type="button"
            className={`search-chip ${filters.billing ? 'is-active' : ''}`}
            onClick={() => setFilters((prev) => ({ ...prev, billing: prev.billing === 'Monthly' ? 'Weekly' : 'Monthly' }))}
          >
            <FaDollarSign />
            {filters.billing || 'Monthly'}
          </button>
          <button type="button" className={`search-chip ${filters.min ? 'is-active' : ''}`} onClick={() => handleRangeChange('min', 'minimum')}>
            Min{filters.min ? `: ${filters.min}` : ''}
          </button>
          <button type="button" className={`search-chip ${filters.max ? 'is-active' : ''}`} onClick={() => handleRangeChange('max', 'maximum')}>
            Max{filters.max ? `: ${filters.max}` : ''}
          </button>
          <button type="button" className={`search-chip ${filters.urgency ? 'is-active' : ''}`} onClick={() => handleToggle('urgency')}>
            <FaClock />
            Urgency
          </button>
          <button type="button" className={`search-chip ${filters.map ? 'is-active' : ''}`} onClick={() => handleToggle('map')}>
            <FaMapMarkerAlt />
            Map
          </button>
          <button type="button" className={`search-chip ${filters.more ? 'is-active' : ''}`} onClick={() => handleToggle('more')}>
            <FaPlus />
            More
          </button>
          <button type="submit" className="search-submit">
            Search
          </button>
        </form>
      </section>
      <section className="airbnb-hero">
        <div className="hero-copy">
          <p className="eyebrow text-uppercase fw-semibold mb-3">Smart roommate matching</p>
          <h1 className="display-4 fw-bold mb-3">Find your people. Find your place.</h1>
          <p className="lead hero-subtext">
            Explore rooms and shared flats with verified hosts, clear pricing, and a vibe-first matching experience.
          </p>
          <div className="d-flex flex-wrap gap-3 mt-4">
            <Link to="/properties" className="btn btn-primary btn-lg">
              Browse rooms
            </Link>
            <Link to="/register" className="btn btn-outline-primary btn-lg">
              Become a host
            </Link>
          </div>
        </div>
        <div className="hero-visual">
          <div className="hero-image-frame">
            <img src={LandingImage} alt="Roommates relaxing" />
          </div>
          <div className="hero-card hero-card-left">
            <div className="hero-card-icon">
              <FaCompass />
            </div>
            <div>
              <p className="mb-1 fw-semibold">Emily</p>
              <span className="hero-card-meta">Today Â· 3 roommates</span>
            </div>
          </div>
          <div className="hero-card hero-card-right">
            <div className="hero-card-avatar">F</div>
            <div>
              <p className="mb-1 fw-semibold">Francesco, 28</p>
              <span className="hero-card-meta">Freelance designer</span>
            </div>
          </div>
        </div>
      </section>
    </div>
  );
}
